import 'materialize-css/dist/css/materialize.min.css'
import M from "materialize-css"

class Hotel extends React.Component {

    componentDidMount() {
        var instance = M.Carousel.init({
            fullWidth: true
          });
    }
    render() {
        return(
            <h1>hola mundo</h1>
        )
    }
}

export default Hotel
